def solution(a, b):
    a_alphabet={}
    for i in a:
        if i in a_alphabet.keys():
            a_alphabet[i]+=1
        else:
            a_alphabet[i]=1
        
    b_alphabet={}
    for i in b:
        if i in b_alphabet.keys():
            b_alphabet[i]+=1
        else:
            b_alphabet[i]=1
    lim={}
    copies=1
    for i in b_alphabet.keys():
        if b_alphabet[i]<100:
            lim[i]=[]
    for i in range(len(b)):
        if b[i]in lim.keys():
            lim[b[i]].append(i)
    i=0;
    j=0;
    while i<len(a):
    
        if a[i]==b[j]:
            if j<len(b)-1:
                j+=1
                i+=1
            else:
                j=0
                i+=1
                copies +=1
        else:
            if a[i] in lim.keys():
                found=False
                for v in range(len(lim[a[i]])):
                    if lim[a[i]][v]>j:
                        j=lim[a[i]][v]
                        found =True
                        break
                if not found:
                    j=lim[a[i]][0]
                    copies+=1
            else:
                if j<len(b)-1:
                    j+=1
                else:
                    j=0
                    copies+=1
        print(i)       
    return copies            
                    
                
        
        
    


              
